                //var y=sinx + cosx;
                //var y=sinx + cosx;
                var OffsetValue = element.coordinateData.center_Point[0] * dx + element.coordinateData.center_Point[1] * dy; //x*cos+y*sin=P(x,y)theta
                var scale = (OffsetValue - position) / bandwidth / color_number;
