        var theta = Math.PI * 30 / 180; //弧度
        var dx = Math.cos(theta);
        var dy = -Math.sin(theta);
        if (Math.abs(dx) < 1e-5)
            dx = 0;
        if (Math.abs(dy) < 1e-5)
            dy = 0;
        var position = 0;
        var color_number = colors.length;
