    NumpadKeyboardComponent.prototype.switchChangAllkey = function () {
        var _this = this;
        var index = _SupportData__WEBPACK_IMPORTED_MODULE_15__["AllFunctionMapping"].findIndex(function (x) { return x.code == _this.KeyBoardManager.getTarget().getNowModeTargetMatrixKey().recordBindCodeName; });
        if (index != -1) {
            var target = this.KeyBoardManager.getTarget().getNowModeTargetMatrixKey();
            //console.log('switchChangAllkey',this.KeyBoardManager.getTarget().getNowModeTargetMatrixKey());
            switch (target.recordBindCodeType) {
                case 'LaunchProgram':
                    return this.getFileName(target.ApplicationPath);
                case 'LaunchWebsite':
                    return target.WebsitePath;
                case 'MacroFunction':
                    //console.log('case MacroFunction:',target);   
                    var obj = this.macroService.find_Data('m_Identifier', target.macro_Data.m_Identifier);
                    if (obj != undefined) {
                        return obj.name;
                    }
                    else {
                        return '';
                    }
            }
            //console.log('AllFunctionMapping_index', index);
            var combinationkey = "";
            var count = 0;
            if (target.combinationkeyEnable) {
                if (target.Shift) {
                    combinationkey += "Shift";
                    if (count > 0) {
                        combinationkey += "+";
                    }
                    count += 1;
                }
                if (target.Alt) {
                    if (count > 0) {
                        combinationkey += "+";
                    }
                    combinationkey += "Alt";
                    count += 1;
                }
                if (target.Ctrl) {
                    if (count > 0) {
                        combinationkey += "+";
                    }
                    combinationkey += "Ctrl";
                    count += 1;
                }
                if (target.Windows) {
                    if (count > 0) {
                        combinationkey += "+";
                    }
                    combinationkey += "Windows";
                    count += 1;
                }
                if (target.hasFNStatus) {
                    if (count > 0) {
                        combinationkey += "+";
                    }
                    combinationkey += "FN";
                    count += 1;
                }
                console.log('switchChangAllkey_count', count);
            }
            ;
            if (count > 0) {
                combinationkey += "+";
            }
            var trans = _SupportData__WEBPACK_IMPORTED_MODULE_15__["AllFunctionMapping"][index].translate;
            var result = combinationkey + trans;
            return result;
        }
        else {
            return this.KeyBoardManager.getTarget().getNowModeTargetMatrixKey().recordBindCodeName;
        }
    };
